A handkerchief hemmer foot is also known as a rolled hem foot, a flat hem foot, a hemmer foot featuring a funnel on the front side where your fabric will roll up into and then the needle will sew the little hem down.

This foot works with domestic tabletop sewing machines and manual sewing machines to give 1/8 inch tiny hemline you find in lightweight fabrics like chiffon, organza, silk or handkerchief.

